import React from "react";
import "./menu-bar.scss";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faFolderPlus ,faFile } from "@fortawesome/free-solid-svg-icons";

const MenuBar = props => {


    return (
        <div className="menu-bar">
            <span className="title">Explorer</span>
            <div className="flex-spacer"/>
            <button className="btn-invisible btn-new-file">
                <FontAwesomeIcon className="icon icon-new-folder" icon={faFolderPlus} />
            </button>
            <button className="btn-invisible btn-new-file">
                <FontAwesomeIcon className="icon icon-new-file" icon={faFile} />
            </button>
        </div>
    )
}


export default MenuBar;
